import React, { Component } from 'react';
import { MDBContainer, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavbarItem, MDBNavbarLink, MDBIcon } from 'mdb-react-ui-kit';

export class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            showBasic: false,
        };
        this.onClick = this.onClick.bind(this);
    }
  
    onClick() {
      this.setState({
          collapse: !this.state.collapse,
        });
    }

    render() {
        return (
            <header>
                <MDBNavbar bgColor="primary"  dark expand="md" scrolling fixed="top">
                    <MDBContainer>
                        <MDBNavbarBrand>
                            <strong>Navbar</strong>
                        </MDBNavbarBrand>

                        <MDBNavbarToggler
                            aria-controls='navbarSupportedContent'
                            aria-expanded='false'
                            aria-label='Toggle navigation'
                            onClick={() => setShowBasic(!showBasic)}
                            >
                            <MDBIcon icon='bars' fas />
                        </MDBNavbarToggler>
                    </MDBContainer>
                </MDBNavbar>
          </header>
        )
    }
}

export default Header
